import React from 'react';
import { Menu, Container } from 'semantic-ui-react';

export default () => {
    return (
        <Menu fixed='top' inverted style={{ padding : '20px' }}>
            <Container>
            <Menu.Item>
                <h2>eR</h2>
            </Menu.Item>

            <Menu.Menu position="right">
                <Menu.Item>
                    Login
                </Menu.Item>

            </Menu.Menu>
            </Container>
        </Menu>
    );
}
